import React, { useRef } from "react";
import Slider from "react-slick";
import "../style.css";





export default function ProductCollateral() {
 

  return (
    <div className='product-collateral'>
            <ul className='toggle-tabs'>
                <li className='tab-current'>
                    <span>
                        Lịch chiếu
                    </span>
                </li>
                <li className='tab-last'>
                    <span>
                        Giá vé
                    </span>
                </li>
            </ul>
        </div>
  );
}
